        return 'Arya'
    if n < 6:
        return 'Jon'
    arr = [1, 0, 1, 1, 1, 1, 0, 0]
    for i in range(8, n + 1):
        if arr[i // 2] == 0 or arr[i // 3] == 0 or arr[i // 4] == -1 or (arr[i // 5] == 0):
            arr.append(1)
        elif arr[i - 2] == 0 or arr[i - 3] == 0 or arr[i - 4] == 0 or (arr[i - 5] == 0):
            arr.append(1)
        else:
            arr.append(0)
    return 'Jon' if arr[n] == 1 else 'Arya'

